import './App.css';


function App(){
  return (
    <div>
      <Menu></Menu> 
      <Footer></Footer>
      <div className = "container">
        <h1> Hi, I'm Fil. </h1>
        <h2> I'm a cool duu </h2>
        <h2> I swear </h2>
        <h2> I promise, don't hate. </h2>
      </div>
    </div>
  );
}

export default App;
